  false,\n\t\"url\": null,\n\t\"notes\": \"These data are spreadsheet data which are
  a subset of thesis data for the Degree of Doctorate of Philosophy in Marine Science.
  The objectives of the study are to determine how community structure of the Mobile
  Tensaw Delta has changed due to invasive submerged aquatic vegetation (SAV) altering
  food web interactions.nnData are in .csv format. Parameters include: latitude, longitude,
  SAV type, species caught in throw trap, species abundance in throw trap, leaf surface
  area within trap, meters2 surface area (leaf surface area multiplied by 4), ratio
  between species abundance and leaf surface area of each type of SAV, and ash-free
  dry weight of sampled SAV.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
